import {MOSTRAR_CONFIGURACION } from '../actions/actionConfiguracion.js'


const initialState = {
    prueba: []
}

export function reducerConfiguracion(state = initialState, action) {
    switch (action.type) {
        case MOSTRAR_CONFIGURACION:
            console.log(action.configuracion);
            return Object.assign({}, state, { prueba: action.configuracion })
        default:
            return state
    }
}
